    align-items: center;
    justify-content: center;
    margin: 0 auto;
    padding:0;
    width:100%;
`

export const CartListli = styled.li`
    align-items: center;
    margin: 0 auto;
    width:100%;
`

export const TotalStyle = styled.div`
    align-items: center;
    margin: 0 auto;
    font-family: Avenir;
    font-weight: 600;
